import React from 'react';
import './projects.css';

class Projects extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            name: "Overdue",
            about: "Counting your monthly expenses",
        }
    };

    render() {
        return (
            <div className="App">

                <div style={{ objectFit: "cover", left: 0, backgroundColor: '#fff'}} className="split">
                    <img className="mockupImg"></img>
                </div>

                <div style={{ right: 0, backgroundColor: '#0000' }} className="split">
                    <h1>{this.name}</h1>
                    <p>{this.about}</p>
                </div>

            </div>
            );
    }

}

export default Projects;
